09-26 17:49:12','system','2019-01-29 17:05:13','0：初始密码修改策略关闭，没有任何提示；1：提醒用户，如果未修改初始密码，则在登录时和点击菜单就会提醒修改密码对话框；2：强制实行初始密码修改，登录后若不修改密码则不能进行系统操作','2'),('1044886594903089152','用户管理-账号密码修改策略','sys.user.passwordModify','1','system','2018-09-26 17:49:12','system','2019-01-29 17:05:18','0：密码修改策略关闭，没有任何提示；1：提醒用户，如果未修改初始密码，则在登录时和点击菜单就会提醒修改密码对话框；2：强制实行初始密码修改，登录后若不修改密码则不能进行系统操作。','2'),('1044886594970198016','用户管理-账号密码修改策略验证周期','sys.user.passwordModifyCycle','30','system','2018-09-26 17:49:12','system','2019-01-29 17:05:22','密码安全修改周期是指定时间内提醒或必须修改密码（例如设置30天）的验证时间（天），超过这个时间登录系统时需，提醒用户修改密码或强制修改密码才能继续使用系统。单位：天，如果设置30天，则第31天开始强制修改密码','2'),('1044886595028918272','用户管理-密码修改多少次内不允许重复','sys.user.passwordModifyNotRepeatNum','1','system','2018-09-26 17:49:12','system','2019-01-29 17:05:26','默认1次，表示不能与上次密码重复；若设置为3，表示并与前3次密码重复','2'),('1044886595091832832','用户管理-账号密码修改最低安全等级','sys.user.passwordModifySecurityLevel','0','system','2018-09-26 17:49:12','system','2019-01-29 17:05:30','0：不限制等级（用户在修改密码的时候不进行等级验证）\r；1：限制最低等级为很弱\r；2：限制最低等级为弱\r；3：限制最低等级为安全\r；4：限制最低等级为很安全','2'),('1106389027564822528','短信服务-应用配置默认应用名称','sms.appinfo.appName','消息服务','system','2019-03-15 10:57:55','system','2019-03-15 10:57:55','用于一键创建应用','0'),('1107818007507267584','短信服务-短信模板最大字数','sms.tpl.contentMaxSize','500','system','2019-03-19 09:36:10','admin','2019-07-17 13:11:57','短信模板内容输入的最大字数','0');
